import React, { Component } from 'react';


class Footer extends Component {


    render() { 
        var footerStyle = {
            position: 'relative',
            marginBottom: '0',
            marginTop: '20rem',
            outlineStyle: "solid"   
        }

        var buttonStyle = {
            width: '50%'
        }

        return (
        <div className="container" style={footerStyle}>

            <div className="row">
                <div className="column column-50"><div className="button button-outline" style={buttonStyle}>Calculator</div></div>
                <div className="column column-50"><div className="button button-outline" style={buttonStyle}>Data</div></div>
            </div>

        </div>
            );
    }
}
 
export default Footer;
